/// Returns a randomly selected element from the given array of strings, or nil if the array is empty.
/// 
/// - Parameters:
///   - array: A non-nil array of String elements.
/// - Returns: A randomly selected String element, or nil if the array is empty.
///
/// ```swift
/// func randomElementFromStringArray(_ array: [String]) -> String? {
///     return array.randomElement()
/// }
/// ```

REFERENCES:
/// Генерирует случайный элемент из массива строк.
/// - Parameter array: Массив строк.
/// - Returns: Случайный элемент из массива.
func randomElementFromStringArray(_ array: [String]) -> String? {
    return array.randomElement()
}
